import React, { Component } from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  .iphone-body{
    height: 475px;
    width: 240px;
    background-color: white;

    margin: auto;
    border-width: 1px;
    border-color: lightgray;
    border-style: solid;
    border-radius: 25px;
  }

  .iphone-screen{
    height: 366px;
    width: 210px;
    /* margin-top: 25px; */
    background-color: black;
  }

  .iphone-sensor{
    height: 5px;
    width: 5px;

    margin-top: 15px;
    margin-bottom: 15px;

    background-color: #eeeeee;
    border: 1px solid lightgray;
    border-radius: 50%;
  }

  .iphone-speaker{
    height: 3px;
    width: 45px;

    margin-top: 15px;
    margin-bottom: 15px;

    background-color: #eeeeee;
    border: 1px solid lightgray;
    border-radius: 3px;
  }

  .iphone-camera{
    position: absolute;
    top: 19px;
    left: 385px;
    height: 8px;
    width: 8px;

    margin-top: 15px;
    margin-bottom: 15px;

    background-color: #eeeeee;
    border: 1px solid lightgray;
    border-radius: 50%;
  }

  .center{
    margin-left: auto;
    margin-right: auto;
  }

  .iphone-button{
    height: 30px;
    width: 30px;

    margin-top: 10px;
    margin-bottom: 15px;

    background-color: #eeeeee;
    border: 1px solid lightgray;
    border-radius: 50%;
  }
`;

class Iphone extends Component{
  render() {
    return (
      <Wrapper>
        <div className="iphone-body">
          <div className="iphone-sensor center" />
          <div className="iphone-camera" />
          <div className="iphone-speaker center" />
          <div className="iphone-screen center"/>
          <div className="iphone-button center"/>

        </div>  
      </Wrapper>
    );
  }
}

export { Iphone };
